import React, { useState } from "react";
import { Route, Routes } from "react-router-dom";
import Navbar from "./components/Navbar";
import LandingPage from "./pages/LandingPage";  // Ensure this component is created

const App = () => {
  const [mode,setmode]=useState("light");
  return (
    <div>
      <Navbar />

      <Routes>
        {/* Home page route */}
        <Route path="/" element={<LandingPage />} />

        {/* Other page routes */}
        <Route path="/budget" element={<div>Budget Page</div>} />
        <Route path="/expenses" element={<div>Expense Page</div>} />
        <Route path="/reports" element={<div>Reports Page</div>} />
        <Route path="/tax" element={<div>Tax Page</div>} />
        <Route path="/login" element={<div>Login Page</div>} />
      </Routes>
    </div>
  );
};

export default App;
